(284, '27.5', '6460600', '105', '1 034 500', '82', '10', '13', '100 000', '5', '2', 'Flambée des cas de COVID sur Tamatave : 8 staff en arrêt maladie 14 jours dont Mirana, Romuald (compta) et Volatiana\r\nEncadrement de la réception (en l’absence de Volatiana et Mirana)\r\nAccueil formateur FMFP', NULL, 'Avril 2021\r\nInternational SOS : le 01/04 pour 25 pax (confirmé)\r\nBuffet de Pâques : 04/04\r\nDSRPJ-MJS : 30 pax (en attente de dates et confirmation)\r\nUGP – TRF : 30 pax (en attente de dates et confirmation)\r\nPNUD : du 13 au 16/04, 50 pax (en attente de confirmation)', NULL, '2 chambres en mission Calypso : formateurs FMFP', NULL, NULL, 'Panne sur ascenseur Ulysse : Climatel ne pourra libérer que mardi prochain un technicien pour récupérer les pièces de M. Pinou. Organisation avec M. Hery en cours.\r\nRéparation grille local groupe\r\nSuite confection plateau room service\r\nFermeture chambres Ulysse (en cours)\r\nPiscine 28°C (chauffage en cours)\r\nMeuble froid cuisine positif : +7°C \r\nMeuble froid cuisine négatif : -5°C \r\nChambre froide économat négative : -14°C\r\nChambre froide économat positive : éteinte\r\nConsommation JIRAMA : 1 923 kwh', 'Redressement fiscal depuis DGI (lettre en décembre 2019)\r\nPlainte pour vol : Prochaine convocation le 1er avril pour 6 employés de l’hôtel et 3 V-Securité. D’ici là, le bagagiste est retenu en prison.', '2021-03-31 00:00:00', 49, NULL, NULL, NULL),
(285, '23.2', '6 490 500', '58', '1 421 500', '32', '6', '20', '295 500', '5', '5', 'Flambée des cas de COVID sur Tamatave : 6 staff en arrêt maladie 14 jours dont Mirana et Romuald (compta)\r\nEncadrement de la réception (en l’absence de Volatiana et Mirana)\r\nReprésentation de l’hôtel au tribunal dans affaire de vol : 9 prévenus (le bagagistes, 3 agents VSécurité, 4 cuisiniers, 1 magasinier), 3 témoins (2 agents VSécurité + Mirana mais cette dernière était absente pour COVID), 1 plaignant (moi-même). Les 9 détenus ont été relaxés en raison des doutes qui subsistaient dans l’affaire et sur le principe que le doute bénéficie aux prévenus mais nous avons 10 jours pour faire appel. Ils avaient pris un avocat et nous étions très mal préparés côté plaignant. J’ai vraiment sous-estimé cette audience comme c’était ma première fois dans une telle situation. Il en ressort quand même que VSécurité a été très défaillant dans l’affaire puisque même les témoins qui ont pris en flagrant délit le bagagiste n’ont pas réussi à expliquer leur manière de procéder dans une telle situation, ce qui a justifié les doutes de la juge. Pour info, sur les 3 agents VSécurité prévenus, 2 ont été mutés sur CTA et 1 (le vieux) est en « vacances » avant de reprendre un poste à ce que j’ai compris.\r\nPour info, aujourd’hui nous avons procédé au licenciement à l’amiable de Volatiana (réception), puisqu’elle revenait ce matin-même de sa quatorzaine COVID. Après un long entrevue de 3 heures, elle, la RH et moi-même sommes arrivées à un accord et elle a quitté son poste dans la foulée. Globalement tout s’est bien déroulé et nous étions bien préparées. Sa remplaçante commence lundi et sera accompagnée de Mamy RBH qui est arrivé hier. Ce dernier a une mission de 1 mois pour la restructuration de la réception, notamment avec l’arrivée des pods. Les pods sont sur la route et attendus pour ce dimanche à l’hôtel', 'Accueil formateur FMFP\r\nAppui de la direction au tribunal', 'International SOS : le 01/04 pour 25 pax (fait)\r\nBuffet de Pâques : 04/04\r\nDSRPJ-MJS : 30 pax (en attente de dates et confirmation)\r\nUGP – TRF : 30 pax (en attente de dates et confirmation)\r\nPNUD : du 13 au 16/04, 50 pax (en attente de confirmation)', NULL, '3 chambres en mission Calypso : 2 pour formateurs FMFP et 1 pour mission Mamy RBH', NULL, NULL, 'Panne sur ascenseur Ulysse : Climatel ne pourra libérer que mardi prochain un technicien pour récupérer les pièces de M. Pinou. RDV prévu avec M. Hery le jeudi 8 avril à 9H chez M. Pinou pour voir la carte\r\nDépannage fuite d’eau toiture Ulysse\r\nCampagne anti-rouille toiture (en cours)\r\nPiscine 28°C (chauffage en cours)\r\nMeuble froid cuisine positif : +7°C \r\nMeuble froid cuisine négatif : -5°C \r\nChambre froide économat négative : -14°C\r\nChambre froide économat positive : éteinte\r\nConsommation JIRAMA : 1 519 kwh', 'Redressement fiscal depuis DGI (lettre en décembre 2019)\r\nPlainte pour vol : tous relaxés, possibilité de faire appel sous 10 jours', '2021-04-01 00:00:00', 49, NULL, 22, 16),
